  sans: 'Barlow, Arial',
  serif: '"Cormorant Unicase", "Palatino", "sans-serif"',
}

export default function Index() {
  return (
    <div>
      <h1>Hello Next Website</h1>
      <style jsx>{`
        @import url('https://fonts.googleapis.com/css?family=Cormorant+Unicase|Barlow');

        h1 {
          font-family: ${fonts.serif};
        }
      `}</style>
    </div>
  )
}
